import logo from './logo.svg';
import './App.css';
import Home from "./Pages/Home/Home";
import Products from "./Pages/Products/Products";
import Cart from "./Pages/Cart/Cart";

function App() {
  return (
    <div className="App">
     <Home/>
     <Products/>
     <Cart/>
    </div>
  );
}

export default App;
